import React from "react";
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Footer from "./Footer";
import Header from "./Header";
import BlogOne from "./BlogOne";
import BlogTwo from "./BlogTwo";
import Navbar from "./Navbar";
import BlogThree from "./BlogThree";
import './Main.css'
import {Card, CardContent, CardMedia} from "@material-ui/core";


function Main(){
    let currentDate = new Date();
    let day = currentDate.getDate();
    let month = currentDate.getMonth();
    let year = currentDate.getFullYear();

    return(
   <div className={"main"}>
       <style>
           @import url('https://fonts.googleapis.com/css2?family=Indie+Flower&family=Nunito:wght@200&family=Patrick+Hand&display=swap');
       </style>
       <BrowserRouter>
           <Navbar/>
           <Header/>
           <p className={"pOne"}>Welcome to my site! Call me Gia, the person behind this website. The focus of this website is my life
           as a plus sized woman living in this extremely judgemental world. Social media, entertainment, advertisements,
           and even people around me are telling me that being skinny/fit is the ultimate life of living. I am here
           to...well live my life. The way I want it to be. I am here to tell people what it is like Living Plus Sized.
           Whether you are plus sized yourself, or not, I hope you can learn from my website or relate to the stories
           that I will tell. So swift through the blogs that I have posted below, I suggest starting with the Introduction
           post below if you haven't been here already, and enjoy the many (emotional) stories that I have to tell.</p>

           <Card>
               <CardContent>
                   <CardMedia>
                       <img src={"https://images.squarespace-cdn.com/content/v1/58a7541bd482e9746468c47c/1560374855368-" +
                       "JAS3TBEI6Y3S3YJIUVU3/%E2%80%9CYou+have+been+criticizing+yourself+for+years+and+it+hasn%E2%80%99t+" +
                       "worked.+Try+approving+of+yourself+and+see+what+happens.%E2%80%9D+%E2%80%94+Louise+Hay"}
                            alt={"Loving your body quote by Louise Hay"}/>
                   </CardMedia>
                  <h4>Introduction</h4>
                   <h6>Date written: {month} {day}  {year}</h6>
                   <p>Learn more about me, what plus size means, and how this website can positively effect you in the
                   long run.</p>
               </CardContent>
           </Card>

           <p className={"pTwo"}>Keep yourself updated with the latest top stories from New York Times:</p>
           <Routes>
               <Route exact path="/blogone" element={<BlogOne/>}/>
               <Route exact path="/blogtwo" element={<BlogTwo/>}/>
               <Route exact path="/blogthree" element={<BlogThree/>}/>
           </Routes>
           <Footer/>
       </BrowserRouter>


   </div>
    )
}

export default Main;
